import React from "react";
import '../App.css';


function Homepage(){
    return (
        <div>
            <header>
                <h1>Welcome to My Simple Homepage</h1>
            </header>
        <main>
            <p>This is a basic homepage created with React.</p>
        </main>
        </div>
    )
}

export default Homepage;
